  \"Examination of Contaminants Using Mussels and Paddlefish as indicators 2000 Ohio
  River Islands National Wildlife Refuge\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T23:04:48.641857\",\n\t\"name\": \"examination-of-contaminants-using-mussels-and-paddlefish-as-indicators-2000-ohio-river-isl\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of the study is to examine
  the extent of contamination at the Ohio River Islands National Wildlife Refuge with
  emphasis on PCB's and use paddlefish and mussels as bioindicators of this contamination.
  The study will specifically address the following:The relative contamination of
  important resource areas on the Ohio River Islands, NWR. 2) The impacts to trust
  species on the refuge from this contamination, 3) The implications for long term
  health and viability for those trust populations with emphasis on paddlefish and
  mussels. Parameters include reproductive success, health of the adult, and the pathways
  of exposure, 4) Added impacts from a large pulp and paper mill proposed at river
  mile 282 will be assessed at the request of West Virginia Field Office by examination
  of dioxins in paddlefish reproductive tissue. 5) The investigation will also validate
  biomarkers for paddlefish as indicators of fish health which have already been established
  for other fish species.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
